            }
            is ClientException.Forbidden -> {
                buf.putInt(2)
                Unit
            }
            is ClientException.TokenExpired -> {
                buf.putInt(3)
                Unit
            }
            is ClientException.NetworkBroken -> {
                buf.putInt(4)
                Unit
            }
            is ClientException.TopicNotFound -> {
